
document.addEventListener("DOMContentLoaded", function () {
    const form = document.getElementById("asrsForm");
    const questionsContainer = document.getElementById("questionsContainer");
    const resultContainer = document.getElementById("resultContainer");
    const scoreElement = document.getElementById("score");
    const downloadButton = document.getElementById("downloadPdf");

    const questions = [
        "How often do you have trouble wrapping up the final details of a project, once the challenging parts have been done?", 
        "How often do you have difficulty getting things in order when you have to do a task that requires organization?", 
        "How often do you have problems remembering appointments or obligations?", 
        "When you have a task that requires a lot of thought, how often do you avoid or delay getting started?", 
        "How often do you fidget or squirm with your hands or feet when you have to sit down for a long time?", 
        "How often do you feel overly active and compelled to do things, like you were driven by a motor?",
        "How often do you make careless mistakes when you have to work on a boring or difficult project?", 
        "How often do you have difficulty keeping your attention when you are doing boring or repetitive work?", 
        "How often do you have difficulty concentrating on what people say to you, even when they are speaking to you directly?", 
        "How often do you misplace or have difficulty finding things at home or at work?", 
        "How often are you distracted by activity or noise around you?", 
        "How often do you leave your seat in meetings or other situations in which you are expected to remain seated?",
        "How often do you feel restless or fidgety?", 
        "How often do you have difficulty unwinding and relaxing when you have time to yourself?", 
        "How often do you find yourself talking too much when you are in social situations?", 
        "When youâ€™re in a conversation, how often do you find yourself finishing the sentences of the people you are talking to, before they can finish them themselves?", 
        "How often do you have difficulty waiting your turn in situations when turn taking is required?", 
        "How often do you interrupt others when they are busy?"
    ];

    const options = ["Never", "Rarely", "Sometimes", "Often", "Very Often"];

    // Generate questions
    questions.forEach((question, index) => {
        const div = document.createElement("div");
        div.classList.add("question");
        div.innerHTML = `<p>${index + 1}. ${question}</p>`;
        
        const optionsWrapper = document.createElement("div");
        optionsWrapper.classList.add("options"); // Wrap options in a div
        
        options.forEach((option, value) => {
            optionsWrapper.innerHTML += `
                <label>
                    <input type="radio" name="q${index}" value="${index < 6 ? value : option}" data-label="${option}">
                    ${option}
                </label>`;
        });

        div.appendChild(optionsWrapper);
        questionsContainer.appendChild(div);
    });

    form.addEventListener("submit", function (event) {
        event.preventDefault();
        
        let score = 0;
        const formData = new FormData(form);
        for (let i = 0; i < 6; i++) {
            score += parseInt(formData.get(`q${i}`), 10);
        }

        scoreElement.textContent = score;
        resultContainer.classList.remove("hidden");
    });

    downloadButton.addEventListener("click", function () {
        const { jsPDF } = window.jspdf;
        const doc = new jsPDF();

        // Base64 Placeholder Image (Replace with actual image if needed)
        const headerImage = "data:image/jpeg;base64,"; // Use a valid Base64 image

        // Draw Header Image if available
        if (headerImage) {
            doc.addImage(headerImage, "JPEG", 10, 10, 190, 30);
        }

        // Document Title and Introduction
        let y = 60;
        doc.setFontSize(14);
        doc.text("Assessment Results", 10, y);
        y += 10;
        doc.setFontSize(10);
        doc.text("Thank you for completing the assessment. Below are your answers:", 10, y);
        y += 10;

        const formData = new FormData(form);

        // Loop through questions and get the selected labels
        questions.forEach((question, index) => {
            const selectedInput = document.querySelector(`input[name="q${index}"]:checked`);
            const selectedLabel = selectedInput ? selectedInput.getAttribute("data-label") : "Not Answered";

            doc.text(`${index + 1}. ${question}`, 10, y);
            y += 6;
            doc.text(`Answer: ${selectedLabel}`, 15, y, { maxWidth: 180 });
            y += 8;

            if (y > 270) { // Prevent overflow, add new page if necessary
                doc.addPage();
                y = 20;
            }
        });

        // Display Score
        doc.setFontSize(12);
        y += 10;
        doc.text("You Scored: " + scoreElement.textContent + "/18", 10, y);
        y += 10;
        
        // Add a concluding message
        const footerText = `Thank you for completing the Adult ADHD screener. It's important to remember that this screener is just a preliminary tool designed to help identify potential areas of concern. It is not a comprehensive diagnostic assessment. If you scored fourteen (14) or more, you're likely to have the symptoms consistent with ADHD in adults. We recommend you seek an assessment and diagnosis from one of our qualified specialists.`;
        
        doc.setFontSize(10);
        doc.text(footerText, 10, y, { maxWidth: 180 });

        doc.save("Assessment_Results.pdf");
    });
});
